import React from 'react';
import Login from './login.js';
import { Jumbotron, Container } from 'reactstrap';

const Home = (props) => {
    return (
        <div>
            <Jumbotron fluid className="marketingImage">
                <Container fluid>
                    <h2 className="display-3">Keep track of your favorite recipes</h2>
                    <p>This is a sample text</p>
                </Container>
            </Jumbotron>
            <Login />
        </div>
    )
}

export default Home;
